def max_len_sub(arr, n):
    if n == 0:
        return 0

    max_length = 1
    current_length = 1

    for i in range(1, n):
        if abs(arr[i] - arr[i - 1]) == 1:
            current_length += 1
            max_length = max(max_length, current_length)
        else:
            current_length = 1

    return max_length

