def count_Substrings(s, n):
    count = 0
    length = len(s)

    for i in range(length):
        for j in range(i + 1, length + 1):
            substring = s[i:j]
            digit_sum = sum(int(char) for char in substring if char.isdigit())
            if digit_sum == len(substring):
                count += 1

    return 'Passed' if count == n else 'Not Passed'

