def lcm(a, b):
    from math import gcd
    return abs(a * b) // gcd(a, b)

def answer(range_start, range_end):
    for i in range(range_start, range_end):
        for j in range(i + 1, range_end):
            if lcm(i, j) >= range_start and lcm(i, j) <= range_end:
                return (i, j)
    return None

