    while pos_index < len(pos) and neg_index < len(neg):
        result.append(pos[pos_index])
        result.append(neg[neg_index])
        pos_index += 1
        neg_index += 1

    while pos_index < len(pos):
        result.append(pos[pos_index])
        pos_index += 1

    while neg_index < len(neg):
        result.append(neg[neg_index])
        neg_index += 1

    return result

