def swap_count(str):
    open_brackets = 0
    close_brackets = 0

    for char in str:
        if char == '(':
            open_brackets += 1
        elif char == ')':
            if open_brackets > 0:
                open_brackets -= 1
            else:
                close_brackets += 1

    return (open_brackets + close_brackets) // 2

