    print(no_of_subsequences([1,2,3,4], 10))
except Exception as e:
    print(e)
try:
    print(no_of_subsequences([4,8,7,2], 50))
except Exception as e:
    print(e)
try:
    print(no_of_subsequences([5,6,7,8], 15))
except Exception as e:
    print(e)

